package operators;

public class arithmetic {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a= 50;
		int b= 60;
		int c= a*a + b*b;
		int d= (a+b) * (a+b);
		int e= b/a;
		int f= b%a;
		int alpha= ++a;
		int beta= --a;
		int gama= beta++;
		System.out.println(alpha+" "+beta+" "+gama);

	}

}
